BEGIN TRANSACTION;
CREATE TABLE "store" (
  "id" int(11) NOT NULL ,
  "state_id" int(11) DEFAULT NULL,
  "city_id" int(11) DEFAULT NULL,
  "address" varchar(511) DEFAULT NULL,
  "store_code" varchar(255) DEFAULT NULL,
  "phone" varchar(255) DEFAULT NULL,
  "service" varchar(255) DEFAULT NULL,
  "photo_hours" varchar(255) DEFAULT NULL,
  "pharmacy_hours" varchar(255) DEFAULT NULL,
  "minuteclinic_hours" varchar(255) DEFAULT NULL,
  "url" varchar(255) DEFAULT NULL,
  "completed" int(11) DEFAULT NULL, latitude REAL NULL, longitude REAL NULL, timezone TEXT NULL,
  PRIMARY KEY ("id")
);
CREATE TABLE "state" (
  "id" int(11) NOT NULL ,
  "name" varchar(255) DEFAULT NULL,
  "url" varchar(255) DEFAULT NULL,
  "completed" int(11) DEFAULT NULL,
  PRIMARY KEY ("id")
);
CREATE TABLE "city" (
  "id" int(11) NOT NULL ,
  "name" varchar(255) DEFAULT NULL,
  "state_id" int(11) DEFAULT NULL,
  "url" varchar(255) DEFAULT NULL,
  "completed" int(11) DEFAULT NULL,
  PRIMARY KEY ("id")
);
CREATE INDEX "store_url" ON "store" ("url");
CREATE INDEX "store_store_code" ON "store" ("store_code");
CREATE INDEX "state_url" ON "state" ("url");
CREATE INDEX "state_name" ON "state" ("name");
CREATE INDEX "city_url" ON "city" ("url");
CREATE INDEX "city_name" ON "city" ("name");
COMMIT;
